import React from "react";
import "./MyBarChart.css"


interface LanguageComponentProps{
    iconName:any,
    langName:any,
    percentage:any,
}
function LanguageComponent({iconName,langName,percentage}:LanguageComponentProps) {
  return (
    <div className="p-4 grid grid-cols-[auto_1fr] items-center hover:bg-gray-200 dark:hover:bg-[#222] bg-gray-200 dark:bg-[#111] rounded transition-hover duration-150 cursor-default">
        <div className="lang-icon-medium grid grid-cols-[auto_1fr] gap-x-3 w-[150px]  justify-left items-start">
            {iconsSmall[iconName]}
            <p className="text-left">{langName}</p>
            <p className=" font-thin text-2xl col-span-2">{percentage}%</p>
        </div>
        <div className="bg-gray-200 dark:bg-[#111]">
        <div className="h-3 rounded-tr-xs rounded-br-xs bg-black dark:bg-[#38BDF8]" style={{width:`${percentage}%`}}></div>
        </div>
    </div>
  );
}
